  const [booking, setBooking] = useState([]);
  const [show, setShow] = useState(false);

 const handleClose = () => setShow(false);
 const handleShow = () => setShow(true);
  //  const [emailId, setEmailId] = useState([]);
  //   const [train_no, setTrainNo] = useState("");
  //   const [train_name, setTrainName] = useState("");
  //   const [fname, setFname] = useState("");
  //   const [lname, setLname] = useState("");
  //   const [age, setAge] = useState("");
  //    const [start_from, setStartFrom] = useState("");
  //    const [coach_no, setCoachNo] = useState("");
  //    const [seat_no, setSeatNo] = useState("");
  //    const [destination, setDestination] = useState("");
  //   const init = ({e}) => {
  //     bookingservice.getbookingEmail(e)
  //       .then((response) => {
  //         console.log("Printing all booking ", response.data);
  //         setBooking(response.data);
  //       })
  //       .catch((error) => {
  //         console.log("Something went wrong", error);
  //       });
  //   };
  //  useEffect(() => {
  //    init();
  //  }, []);
  const handleDelete = (id) => {
    console.log("Printing id", id);
    bookingservice
      .remove(id)
      .then((response) => {
        console.log("Booking has been Deleted", response.data);
        init();
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
  useEffect(() => {
    if (e) {
      bookingservice
        .getbookingEmail(e)
        .then((response) => {
          console.log("Printing all booking ", response.data);
          setBooking(response.data);
        })

        //  setEmailId(bookings.data.e);
        //   setTrainNo(bookings.data.train_no);
        //   setTrainName(bookings.data.train_name);
        //   setFname(bookings.data.fname);
        //   setLname(bookings.data.lname);
        //   setAge(bookings.data.age);
        //   setStartFrom(bookings.data.start_from);
        //   setDestination(bookings.data.destination);
        //    setSeatNo(bookings.data.seat_no);
        //    setCoachNo(bookings.data.coach_no);

        .catch((error) => {
          console.log("Something went wrong", error);
        });
    }
  }, []);

  return (
    <div className="showcase">
      <div className="grid-container1">
        {/* <div className="item2" style={{ marginLeft: "28rem", width: "35 rem" }}> */}
        {/* <p> Name:{p}</p>

        <p>Train Name:{t}</p>

        <p>First Name:{fn}</p>

        <p>Last Name:{ln}</p>

        <p>train No.:{tn}</p>

        <p>email:{e}</p>
        <p>age:{age}</p>

        <p>Start from :{start_from}</p>
        <p>destination:{destination}</p>
        <p>coach no:{coach_no}</p>
        <p>seat no:{seat_no}</p> */}
        <div className="tlist">
          {/* <p>email:{e}</p> */}
          <table className="table table-bordered table-dark table-striped">
            <thead className="thead-light">
              <tr>
                <th> Train Name</th>
                <th> Train No</th>
                <th> FirstName</th>
                <th> LastName</th>
                <th> Age</th>
                <th> Start from</th>
                <th> Destination</th>
                <th> emailId</th>
                <th> seat no</th>
                <th> coach no</th>

                <th> Actions </th>
              </tr>
            </thead>
            <tbody>
              <tr key={booking.id}>
                <td>{booking.train_name}</td>
                <td>{booking.train_no}</td>
                <td>{booking.fname}</td>
                <td>{booking.lname}</td>
                <td>{booking.age}</td>
                <td>{booking.start_from}</td>
                <td>{booking.destination}</td>
                <td>{booking.emailId}</td>
                <td>{booking.seat_no}</td>
                <td>{booking.coach_no}</td>
                <td>
                  <button className="btn btn-danger ml-2" onClick={handleShow}>
                    Delete
                  </button>
                  <Modal show={show} onHide={handleClose}>
                    <Modal.Header closeButton>
                      <Modal.Title>Want to Delete Booking?</Modal.Title>
                    </Modal.Header>
                    <Modal.Body>If yes , Click on Delete</Modal.Body>
                    <Modal.Footer>
                      <Button variant="secondary" onClick={handleClose}>
                        Close
                      </Button>
                      <Button
                        variant="danger"
          
                        onClick={(o) => handleDelete(o)}
                      >
                        <Link
                          to="/profile"
                          style={{ color: "white", textDecoration: "none" }}
                        >
                          Delete
                        </Link>
                      </Button>
                    </Modal.Footer>
                  </Modal>
                  </td>
              </tr>
            </tbody>
          </table>
        </div>
        {/* <Link className="btn btn-warning" to={`/payment`}>
          Payment
        </Link> */}
      </div>
      <Link className="btn btn-warning" to="/Addbooking">
        Back
      </Link>
    </div>

    // </div>
  );
};

export default Fullticket;
